//--------------------------------------------------------------------------------------//
//                                       Projects.js                                       //
//--------------------------------------------------------------------------------------//


import React from 'react';
import Slideshow from '../Slideshow/Slideshow';
import DarkModeToggle from '../DarkModeToggle/DarkModeToggle';
import './Projects.css'; 
import personal_project1 from '../images/project_images/maplestory_app.gif';
import personal_project2 from '../images/project_images/invaded_space.gif';
import personal_project3 from '../images/project_images/bullseye.png';
import hackathon1 from '../images/project_images/lyric_link.gif';
import hackathon2 from '../images/project_images/att_empowher.png';
import hackathon3 from '../images/project_images/datafest.png';

// array of slides to use for slideshow pictures
const hackathon_slides = [
  { 
    image: hackathon1, 
    captions: [
      { text: 'SacHacks', style: { } },
      { text: 'React', style: { backgroundColor: 'blue'} },
      { text: 'Django', style: { backgroundColor: 'blue'} }
    ] 
  },
  { 
    image: hackathon2, 
    captions: [
      { text: 'AT&T: EmpowHer', style: { backgroundColor: ''} },
      { text: 'HTML', style: { backgroundColor: 'gray'} },
      { text: 'CSS', style: { backgroundColor: 'gray'} },
    ]

  },
  { 
    image: hackathon3, 
    captions: [
      { text: 'Datafest', style: { } },
      { text: 'Pandas', style: { backgroundColor: 'blue'} }
    ]
  },
];


const personal_projects_slides = [
  { 
    image: personal_project1, 
    captions: [
      { text: 'Maplestory', style: { } },
      { text: 'Flutter', style: { backgroundColor: 'blue'} },
      { text: 'Caption 3', style: { backgroundColor: 'green', color: 'yellow'} }
    ] 
  },
  { image: personal_project2, caption: 'Invaded Space' },
  { image: personal_project3, caption: 'Bullseye' },
];

const coursework_slides = [
];

function Projects() {
  return (
    <div className="projects">
      <div className="projects-header">
        <h1> GitHub </h1>
        <div className = "projects__github-link">
        </div>
      </div>

      {/* section: hackathons */}
      <div className="projects-section">
        <div className="projects__slideshow-container">
          <Slideshow slides={hackathon_slides} />
        </div> 
        <div className="projects-section-text">
          <h2>Hackathons</h2>
          <div>
            <p>• <a href="http://sachacks.io/" target="_blank" rel="noopener noreferrer">SacHacks</a></p>
            <p>• <a href="https://inside.att.jobs/empowherhackathon#subpage/welcome" target="_blank" rel="noopener noreferrer">AT&T: EmpowHer</a></p>
            <p>• <a href="https://norcaldatafest.netlify.app/" target="_blank" rel="noopener noreferrer">DataFest</a></p>
          </div>
        </div>
      </div>

      {/* section: personal projects */}
      <div class="projects-section">
        <div class="projects__slideshow-container">
          <Slideshow slides={personal_projects_slides} />
        </div>
        <div class="projects-section-text">
          <h2>Personal Projects</h2>
          <div>
            <p>• <a href="http://flutter.dev/" target="_blank" rel="noopener noreferrer">Making Maplestory w/ Flutter</a></p>
            <p>• Invaded Space</p>
            <p>• Bullseye</p>
          </div>
        </div>
      </div>

      {/* section: coursework */}
      <div class="projects-section">
        <div class="projects__slideshow-container">
          <Slideshow slides={coursework_slides} />
        </div>
        <div class="projects-section-text">
          <h2>Coursework</h2>
          <div>



          </div>
        </div>
      </div>


    </div>
  );
}
export default Projects;
